<script>

  import getFactions from '~/apollo/queries/faction/factions'
  import getRegions from '~/apollo/queries/region/regions'

  export default {
    layout: 'wotn',
    head: {
      title: "La Guerre de l'Anneau",
      meta: [{
        hid: 'description',
        name: 'description',
        content: "Carte de la Guerre de l'Anneau"
      }],
    },
    data() {
      return {
        toggleActive: false,
        isShowModal: false,
        region: '',
        regions: [],
        factions: [],
        count: 0
      }
    },
    apollo: {
      factions: {
        query: getFactions
      },
      regions: {
        query: getRegions
      }
    },
    methods: {
      getInfo(e) {
        this.title = e.target.id;
        this.region = e.target.getAttribute("aria-valuetext");
      },
      toggleModal(e) {
        if (e && e.target.getAttribute("aria-valuetext")) {
          this.isShowModal = !this.isShowModal;
        } else {
          this.isShowModal = !this.isShowModal;
        }
      }
    }
  }

